       </header>
    <BrowserRouter>
        <Switch>
          <Route exact path="/">
          {/* <p>{!data ? "Loading..." : data}</p> */}
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/messages">
            <Messages />
          </Route>
          <Route path="/notifs">
            <Notifs />
          </Route>
          <Route path="/settings">
            <Settings />
          </Route>
          <Route path="/search">
            <Search />
          </Route>
        </Switch>
    </BrowserRouter>
    </div>
  );
}

export default App;
